    [],nt"revision_timestamp": "2016-07-27T22:58:01.439998",nt"name": "ridgefield-invasive-plant-focused-eradication",nt"isopen":
    false,nt"url": null,nt"notes": "The proposed project is a part of the Refuge
    invasive species management program and willhelp achieve goals and protect priority
    habitats identified in the Refuge CCP. The project will survey approximately 1,500
    acres as part of our Early Detection/Rapid Response (ED/RR) efforts u2013 focusing
    on known species and those on the southwest Washington/WillametteValley watch lists.
    Control will be focused on eradicating 4 species which pose the greatest threat
    and/or have the greatest momentum towards eradication, and can be treated during
    July-September: yellow flag iris, fragrant water lily, water primrose willow (discovered
    in 2013), and Japanese knotweed. In addition, critical momentum will be incremented
    towards depleting the seed bank of the species most in need of eradication ricefield
